import React, { useState, useEffect } from 'react'

const RingSettings = ( {userRingSettings} ) => {

    const [ringOne, setRingOne] = useState('A')
    const [ringTwo, setRingTwo] = useState('A')
    const [ringThree, setRingThree] = useState('A')

    useEffect(() => {
        console.log("ringSetting one: ", ringOne)
        console.log("ringSetting Two: ", ringTwo)
        console.log("ringSetting Three: ", ringThree)
    }, [ringOne, ringTwo, ringThree])

    return (
        <div>
            <div className="settings-subsection">
                <label><a href="https://en.wikipedia.org/wiki/Enigma_rotor_details#Ring_setting">Ring settings (Ringstellung)</a></label>
                <input className="rotor-settings" id="ring-left-pos" type="text" value="A"/>
                <input className="rotor-settings" id="ring-middle-pos" type="text" value="A"/>
                <input className="rotor-settings" id="ring-right-pos" type="text" value="A"/>
            </div>
        </div>
    )
}

export default RingSettings
